import { INTERRUPTION_MODE_ANDROID_DUCK_OTHERS } from 'expo-av/build/Audio';
import React from 'react';
import { View, Text } from 'react-native';
import { createDrawerNavigator } from '@react-navigation/drawer';

import Home from './Home';
import Papers from './Papers';
import Media from './Media';
import { ScaleFromCenterAndroid } from 'react-navigation-stack/lib/typescript/src/vendor/TransitionConfigs/TransitionPresets';

const Drawer = createDrawerNavigator();

export default () => {
    return(
        <NavigationContainer>
            <Drawer.Navigator initialRouteName="Home">
                <Drawer.Screen name="Home" component={Home} />
                <Drawer.Screen name="Media" component={Media} />
                <Drawer.Screen name="Papers" component={Papers} />
            </Drawer.Navigator>
        </NavigationContainer>
    )
}
